import axios from 'axios'

export const FETCH_LATESTMOVIES__BEGIN   = 'FETCH_LATESTMOVIES_BEGIN';
export const FETCH_LATESTMOVIES__SUCCESS = 'FETCH_LATESTMOVIES__SUCCESS';
export const FETCH_LATESTMOVIES__FAILURE = 'FETCH_LATESTMOVIES__FAILURE';

export const fetchLatestMoviesBegin = () => ({
    type: FETCH_PRODUCTS_BEGIN
  });

 export const fetchLatestMoviesSuccess = products => ({
   type: FETCH_PRODUCTS_SUCCESS,
   payload:  products 
 });

 export const fetchLatestMoviesFailure = error => ({
   type: FETCH_PRODUCTS_FAILURE,
   payload: { error }
 });

 export function fetchLatestMovies(){
   console.log("in fetchLatestMovies!!")
   return dispatch=>{
     dispatch(fetchLatestMoviesBegin());
    return axios.get('http://3.17.216.66:4000/latest')
     .then(resp=>{
       const products= resp.data;
       dispatch(fetchProductsSuccess(products))
     })
     .catch(error=>{
       dispatch(fetchProductsFailure(error.message))
     })

   }
 }
